import React from "react";
import OwlCarousel from 'react-owl-carousel';
import image1 from '../../src/bungalow.jpg';
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';
import Heading from "./Core-component/Heading";
const Testi = () =>{
  return(
    <>
    <div className="testimonial-wrp">
    <div className="container services-wrp">
    <Heading
            prefixhead = "Client"
            suffixhead = "Testimonial" 
    />
      <OwlCarousel items={2} className='owl-theme' loop margin={10} nav>
        <div class='item'>
        <img src={ image1 }></img>
        </div>
        <div class='item'>
        <img src={ image1 }></img>
        </div>
        </OwlCarousel>
    </div>
    </div>
    </>
  )
}
export default Testi;
